// --- Proyección gnomónica simple ---
static int project_star(double fov, double ra, double dec, double ra_c, double dec_c, uint32_t *x, uint32_t *y) {
    const double d2r = M_PI / 180.0;
    double ra1 = ra * d2r, dec1 = dec * d2r;
    double ra0 = ra_c * d2r, dec0 = dec_c * d2r;
//printf("fov %g\n",fov);
    double cos_c = sin(dec0)*sin(dec1) + cos(dec0)*cos(dec1)*cos(ra1 - ra0);
    if (cos_c <= 0.0) return 0;

    //double x_rad = (cos(dec1) * sin(ra1 - ra0)) / cos_c;
    double x_rad = (cos(dec1) * sin(ra0 - ra1)) / cos_c;
    double y_rad = (cos(dec0)*sin(dec1) - sin(dec0)*cos(dec1)*cos(ra1 - ra0)) / cos_c;

    //double scale = tan(FOV_DEG * d2r / 2.0);
    double scale = tan(fov * d2r / 2.0);
    double px = (x_rad / scale) * (WIDTH / 2.0) + WIDTH / 2.0;
    double py = (-y_rad / scale) * (HEIGHT / 2.0) + HEIGHT / 2.0;

    if (px < 0 || px >= WIDTH || py < 0 || py >= HEIGHT) return 0;
    *x = (uint32_t)px;
    *y = (uint32_t)py;
    return 1;
}

// --- Parseo OnStep ---
static double parse_ra(const char *s) {
    int h, m; int sec;
    //if (sscanf(s, "%d:%d:%lf", &h, &m, &sec) == 3)
    // ejemplo 00:39:51#
    if (sscanf(s, "%d:%d:%d", &h, &m, &sec) == 3)
        return h + m/60.0 + ((double)(sec))/3600.0;
    return -1;
}

static double parse_dec(const char *s) {
    char sign = '+';
    int d, m = 0; double sec = 0;
    const char *p = s;
    if (*p == '+' || *p == '-') sign = *p++;
    if (sscanf(p, "%d*%d:%lf", &d, &m, &sec) >= 1) {
        double v = d + m/60.0 + sec/3600.0;
        return (sign == '-') ? -v : v;
    }
    return -999;
}

// --- Dibujo ---
static void clear_screen(chip_state_t *state) {
    rgba_t black = {0, 0, 0, 0xFF};
    for (uint32_t i = 0; i < state->width * state->height; i++) {
        buffer_write(state->fb, i * 4, &black, 4);
    }
/*
      uint32_t white= 0XFFFFFFFF;
   // buffer_write(g.fb, 0, &white, 320*4);  // offset 0 = (0,0)
    int row=100;
  uint32_t offset = state->width * 4 * row;
  for (int x = 0; x < state->width * 4; x += 4) {
    buffer_write(state->fb, offset+x, &white, sizeof(white));
  }
*/
}

static void draw_pixel(chip_state_t *state, uint32_t x, uint32_t y, rgba_t color) {
    if (x >= state->width || y >= state->height) return;
    buffer_write(state->fb, (y * state->width + x) * 4, &color, 4);
}

