#define N_CONSTELLATION_SEGMENTS (sizeof(CONSTELLATION_SEGMENTS) / sizeof(CONSTELLATION_SEGMENTS[0]))

#define N_STARS (sizeof(STARS) / sizeof(STARS[0]))

static void draw_line(chip_state_t *state, int x0, int y0, int x1, int y1, rgba_t color) {
    int dx = abs(x1 - x0), sx = x0 < x1 ? 1 : -1;
    int dy = -abs(y1 - y0), sy = y0 < y1 ? 1 : -1;
    int err = dx + dy, e2;
    while (1) {
        if (x0 >= 0 && x0 < (int)state->width && y0 >= 0 && y0 < (int)state->height) {
            buffer_write(state->fb, (y0 * state->width + x0) * 4, &color, 4);
        }
        if (x0 == x1 && y0 == y1) break;
        e2 = 2 * err;
        if (e2 >= dy) { err += dy; x0 += sx; }
        if (e2 <= dx) { err += dx; y0 += sy; }
    }
    
}

static void redraw(chip_state_t *state) {
    //return;
//printf("Se llama a REDRAW\n\n");
    clear_screen(state);

    if (!state->ra_valid || !state->dec_valid) return;
//printf("Se llama a REDRAW y hay coordenadas validas \n\n");
    double ra_c = state->ra_hours * 15.0;
    double dec_c = state->dec_deg;
//double ra_c = 84.0534;
//double dec_c = -1.20;

    double fov=attr_read_float(state->fov_attr);

    for (int i = 0; i < N_STARS; i++) {
        const star_t *s = &STARS[i];
        uint32_t x, y;
        if (project_star(fov, s->ra, s->de, ra_c, dec_c, &x, &y)) {
            int size = (int)(6.0 - s->am);
            // size=6; //666
            if (size < 1) size = 1;
            rgba_t white = {0xFF, 0xFF, 0xFF, 0xFF};
            rgba_t red = {0xFF, 0, 0, 0xFF};
            rgba_t green = {0,0xFF, 0, 0xFF};
            rgba_t blue = {0, 0, 0xFF, 0xFF};

            for (int dy = -size/2; dy <= size/2; dy++) {
                for (int dx = -size/2; dx <= size/2; dx++) {
                    if (i==32)
                    //draw_pixel(state, x + dx, y + dy, white);
                    draw_pixel(state, x + dx, y + dy, red);
                    else if (i==30)
                    draw_pixel(state, x + dx, y + dy, green);
                    else if (i==74)
                    draw_pixel(state, x + dx, y + dy, blue);
                    else draw_pixel(state, x + dx, y + dy, white);
                }
            }
        }
    }

        // Dibujar líneas de constelación
    rgba_t yellow = {0xFF, 0xFF, 0x00, 0xFF}; // amarillo
    //double fov = attr_read_float(state->fov_attr);
    for (int i = 0; i < N_CONSTELLATION_SEGMENTS; i++) {
        uint32_t x0, y0, x1, y1;
        if (project_star(fov, CONSTELLATION_SEGMENTS[i].r0, CONSTELLATION_SEGMENTS[i].d0,
                         ra_c, dec_c, &x0, &y0) &&
            project_star(fov, CONSTELLATION_SEGMENTS[i].r1, CONSTELLATION_SEGMENTS[i].d1,
                         ra_c, dec_c, &x1, &y1)) {
            draw_line(state, x0, y0, x1, y1, yellow);
        }
    }
}

// --- Callbacks UART ---
static void on_uart_rx_data(void *user_data, uint8_t byte) {
  //printf("se llama a on_uart_rx_data\n\n");
    chip_state_t *state = (chip_state_t*)user_data;
    uint32_t debug=attr_read(state->debug_attr);

    if (byte == '#') {
        state->rx_buf[state->rx_len] = '\0';
       if (debug) printf("rx_buf %s\n",state->rx_buf);
        if (strstr(state->rx_buf, ":") && !strstr(state->rx_buf, "*")) {
            double ra = parse_ra(state->rx_buf);
            if (ra >= 0) {
                state->ra_hours = ra;
                state->ra_valid = 1;
                state->consultarRA=false;
               // printf("ra %g\n", state->ra_hours);
                redraw(state);
            }
        } else if (strstr(state->rx_buf, "*")) {
            double dec = parse_dec(state->rx_buf);
            if (dec > -900) {
                state->dec_deg = dec;
                state->dec_valid = 1;
                state->consultarRA=true;
                redraw(state);
            }
        }
        state->rx_len = 0;
    } else {
        if (state->rx_len < RX_BUF_SIZE - 1) {
            state->rx_buf[state->rx_len++] = byte;
        }
    }
}

static void on_uart_write_done(void *user_data) {
    //printf("se llama a on_uart_write_data\n\n");
    // opcional
}

// --- Timer para consulta periódica ---
static void on_timer(void *user_data) {
  //printf("se llama a on_timer\n\n");
    chip_state_t *state = (chip_state_t*)user_data;
    const char cmd_ra[] = ":GR#\n";
    const char cmd_dec[] = ":GD#\n";
    if (state->consultarRA ) 
      uart_write(state->uart, (uint8_t*)cmd_ra, sizeof(cmd_ra) - 1);
    else 
      uart_write(state->uart, (uint8_t*)cmd_dec, sizeof(cmd_dec) - 1);
}

